import { IData } from "../interfaces/IData"
import { BiCheckCircle, BiMessageSquareX } from "react-icons/bi";

export const statusBody = (cell:string) => {
    if(cell === "Completed"){
        return <span className="text-success" > <BiCheckCircle/> {cell}</span>
    } else if(cell === "Editing"){
        return <span className="text-info" > <BiCheckCircle/> {cell}</span>
    } else if(cell === "Incomplete"){
      return <span className="text-danger" > <BiMessageSquareX/> {cell}</span>

  }
    else {
        return <span className="text-danger" >{cell}</span>
    }
}


export const columns = [
    {
      dataField: "name",
      text: "Name",
      sort: true
    },
    {
      dataField: "type",
      text: "Type",
      sort: true
    },
    {
      dataField: "status",
      text: "Status",
      formatter: statusBody,
      sort: true
    },
    {
      dataField: "createdOn",
      text: "Created",
      sort: true
    }
  ];
